import React from 'react';
import Grid from '@material-ui/core/Grid';

const Profile = () => {
    return ( 
        <Grid container spacing={2} >

            <Grid item md>
               <div>
                   <h1>
                      Left side stuff
                   </h1>
               </div>
            </Grid>

    
            <Grid item md>
                Right side stuff
            </Grid>

        </Grid>
    );
}
 
export default Profile;
